css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("warframe-builder.com") {
    [id^="oauth2relay"], [id^="apiproxy"], #background > #conteneur > [id^="a-"], #logo, [id^="p-top"], #copyright, #langue, .separateur_menubar{
        display:none;
        visibility:collapse;
    }
    a, a:active, a:focus, button, button:active, button:focus, .ui-dialog-titlebar-close:hover{
        outline:0 !important;
    }
    body, #background{
        min-width:unset;
        width:100%;
        background:none #111111;
        color:#dddddd;
    }
    #menubar{
        background:none #313131;
        box-shadow:0px 1px 2px 0px #000000;
    }
    .ui-dialog, #changerCasques .casque_float div{
        background:none #313131;
        color:#dddddd;
    }
    .invisible{
/*         display:unset; */
    }
    #background{
        padding-top:45px;
    }
    .conteneur_grand_mod, .conteneur_grand_mod:hover{
        transition:all 0s !important;
        -moz-transition:all 0s !important;
    }
    #conteneur, #footer{
        background:none transparent;
        box-shadow:none;
        border-color:transparent;
    }
    #footer{
        box-shadow:inset 0px 1px 0px -1px #000000;
    }
    #mods #liste_mods #cache-01, #mods #liste_mods #cache-02{
        background:none #111111;
    }
    #navigation div.grande-icone-menu:hover, #navigation div.petite-icone-menu:hover, .vignette:hover, input[type="submit"], input[type="text"], input[type="password"], input[type="search"], button, #menubar #menu ul li a:hover{
        box-shadow:none;
    }
    .vignette:hover{
        outline:1px solid #dddddd;
    }
    #contenu-footer{
        width:800px !important;
    }
    #contenu-footer [id^="liens-"]{
        text-align:center !important;
        margin:0 auto;
    }
    #contenu-footer [id^="liens-"] ul li{
        text-align:left;
    }
    input[type="submit"], input[type="text"], input[type="password"], input[type="search"], button, input[type="text"]:focus, input[type="password"]:focus, input[type="text"]:hover, input[type="password"]:hover, input[type="submit"]:hover, button:hover, #mods #filtres_mods #filtre-nom:hover, #mods #filtres_mods #filtre-nom:focus, #footer{
        background:none #212121;
/*         background:none #d7af62; */
    }
    #liste_mods .scrollbar{
        background:none #000000;
        border-radius:8px !important;
        height:14px;
    }
    #liste_mods .thumb{
        background:none #212121;
        height:10px;
        margin:0;
        padding:0;
        top:0;
        border-radius:8px;
        border:2px solid #000000;
    }
    #liste_mods .thumb:hover, #liste_mods .thumb:active, #liste_mods .thumb:focus{
        background-color:#d7af62;
    }
    #liste_mods .thumb .end{
        background:none transparent;
    }
    input[type="text"]:focus, input[type="password"]:focus, input[type="text"]:hover, input[type="password"]:hover, input[type="submit"]:hover, button:hover, #mods #filtres_mods #filtre-nom:hover, #mods #filtres_mods #filtre-nom:focus{
        outline:1px solid #d7af62;
    }
    .conteneur_vignette, #informations #infos-objet #nom-niveau, #informations #infos-objet #nom-niveau input[type="text"], #informations #infos-objet #nav-builder a, #informations #infos-objet #nav-builder a:visited, #informations #infos-objet #nav-builder a:active, #mods #filtres_mods #allModsMax, #mods #filtres_mods #allModsMin, #mods #filtres_mods #pvpMods, #login, #informations #infos-objet #envoyer_vers, #login div a, #login div a:visited, #compte p, #compte #inscription label, input[type="submit"], input[type="text"], input[type="password"], input[type="search"], button, #builder #casques, #builder #casques a, #builder #casques a:visited, #builder #casques a:active, #builder #rapport a, #builder #rapport a:visited, #builder #rapport a:active, #footer, #footer #contenu-footer ul li:first-child, #footer #contenu-footer ul li a, #footer #contenu-footer ul li a:visited, #footer #contenu-footer ul li a:active, #rechercherBuilds #listeBuilds table tr td a, #rechercherBuilds #listeBuilds table tr td a:visited, .ui-dialog-content, #builder #charge, #builder #stats_arme .ligne_stat div:first-child, #builder #stats_arme .ligne_stat div:nth-child(2), #exporterRapport .nom_skill, #exporterRapport #rapportWarframe .ligne_stat div:first-child, #exporterRapport #rapportSkills .ligne_stat div:first-child, #exporterRapport .ligne_stat div:nth-child(2), #builder #rapport{
        color:#dddddd;
    }
    #exporterRapport .nom_skill{
        font-weight:bold;
    }
    #exporterRapport hr{
        height:1px;
        border-color:transparent;
        background:none rgba(0,0,0,.5);
        box-shadow:0 1px rgba(255,255,255,.15);
    }
    #menubar #menu ul li, #menubar #menu ul li a, #login{
        height:30px;
        line-height:30px;
        background-position:center center !important;
    }
    #menubar #menu ul li a:hover{
        border-bottom:1px solid #dddddd;
    }
    #menubar-home:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_home.png") no-repeat scroll 0 0 !important;
    }
    #menubar-warframes:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_warframes.png") no-repeat scroll 0 0 !important;
    }
    #menubar-armes-principales:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_armes_principales.png") no-repeat scroll 0 0 !important;
    }
    #menubar-armes-secondaires:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_armes_secondaires.png") no-repeat scroll 0 0 !important;
    }
    #menubar-armes-de-melee:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_armes_de_melee.png") no-repeat scroll 0 0 !important;
    }
    #menubar-sentinelles:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_sentinelles.png") no-repeat scroll 0 0 !important;
    }
    #menubar-armes-de-sentinelles:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_armes_de_sentinelles.png") no-repeat scroll 0 0 !important;
    }
    #menubar-builds-recents:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_builds_recents.png") no-repeat scroll 0 0 !important;
    }
    #menubar-comparateur:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_comparateur.png") no-repeat scroll 0 0 !important;
    }
    #menubar-piratage:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_piratage.png") no-repeat scroll 0 0 !important;
    }
    #menubar-aide:hover a{
        background:#d7af62 url("http://warframe-builder.com/web/images/menubar_aide.png") no-repeat scroll 0 0 !important;
    }
    #informations #infos-objet #nav-builder a:hover, #mods #filtres_mods #allModsMax:hover, #mods #filtres_mods #allModsMin:hover, #builder #casques a:hover, #builder #rapport a:hover, #footer #contenu-footer ul li a:hover, #builder #charge:hover{
        color:#d7af62;
        text-decoration:none;
    }
    #mods{
        margin:0 auto;
        padding-top:0;
    }
    #mods #filtres_mods{
        margin-top:5px;
    }
    #builder #points #bg-points #progression-points{
        box-shadow:none;
        border-radius:8px;
    }
    #builder #points #bg-points #progression-points #compteur-points-restants{
        background:none #d7af62;
        color:#111111;
        margin-top:-1px;
        box-shadow:inset 0px 0px 3px 0px #000000;
    }
    #rechercherBuilds #listeBuilds table tbody tr:hover, #rechercherBuilds #listeBuilds table tbody tr:hover a{
        background:#d7af62;
        color:#111111;
    }
    #progression-points{
/*         background-color:#d7af62; */
    }
    #progression-points[style*="background-color: rgb(18, 255, 0);"]{
/*         background-color:red !important; */
    }
    div[class^="slot_polarite_"]{
        background-size:18px auto !important;
    }
    .slot_polarite_1{
        background:transparent url("http://warframe-builder.com/web/images/polarite_1.png") !important;
    }
    .slot_polarite_2{
        background:transparent url("http://warframe-builder.com/web/images/polarite_2.png") !important;
    }
    .slot_polarite_3{
        background:transparent url("http://warframe-builder.com/web/images/polarite_3.png") !important;
    }
    .slot_polarite_4{
        background:transparent url("http://warframe-builder.com/web/images/polarite_4.png") !important;
    }
    .slot_polarite_5{
        background:transparent url("http://warframe-builder.com/web/images/polarite_5.png") !important;
    }
    .slot_polarite_6{
        background:transparent url("http://warframe-builder.com/web/images/polarite_6.png") !important;
    }
    img[src^="/web/images/icone"], img[src="/web/images/reset.png"]{
        width:10px;
        height:10px;
        padding-left:10px;
        box-sizing:border-box;
        background-size:10px 10px !important;
        background-repeat:no-repeat;
    }
    img[src="/web/images/reset.png"]{
        background:url(data:image/png;base64,) no-repeat center;
    }
    img[src="/web/images/icone_glace.png"]{
        background:url(data:image/png;base64,) no-repeat center;
    }
    img[src="/web/images/icone_electrique.png"]{
        background:url(data:image/png;base64,) no-repeat center;
    }
    img[src="/web/images/icone_poison.png"]{
        background:url(data:image/png;base64,) no-repeat center;
    }
    img[src="/web/images/icone_feu.png"]{
        background:url(data:image/png;base64,) no-repeat center;
    }
}
